script: |
  super -f text -I q4390.spq | sort > q4390.out

inputs:
  - name: q4390.spq
    data: |
      SELECT DISTINCT 30 + - ( - - col1 ) * + col1, - 70 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q4390.out
    data: |
      -411	-70
      -6531	-70
      29	-70
